import React from 'react';
import './CSS/Etlap.css';

const Etlap = () => {
  const etelek = [
    { nev: 'Margherita pizza', leiras: 'Paradicsomszósz, mozzarella, bazsalikom, olívaolaj' },
    { nev: 'Carbonara spagetti', leiras: 'Tojás, parmezán sajt, guanciale, bors' },
    { nev: 'Tiramisu', leiras: 'Tojás, cukor, mascarpone, savoiardi, kávé, kakaópor' },
  ];

  return (
    <div className='Etlap'>
      <h1>Étlap</h1>
      {etelek.map((etel, index) => (
        <div key={index} className='etel'>
          <h2>{etel.nev}</h2>
          <p>{etel.leiras}</p>
        </div>
      ))}
      <footer className='footer1'>
        <p>&copy; {new Date().getFullYear()} FoodRapid. Minden jog fenntartva.</p>
        <p>Kövess minket a közösségi médiában!</p>
      </footer>
    </div>
  );
};

export default Etlap;
